/*After creating three tables which are connected to one another by foreign keys, we can now proceed to import dat into each table by DATA IMPORT WIZARD*/
/*Now that we have imported Data,let's perform some analysis on our data to draw valuable insights*/

-- JOINS Functions:
-- 1.Show customer ID, email, membership tier, and product name for each customer.
SELECT 
t.Customer_ID,
t.Product_Name,
c.Email_Address,
c.Membership_Tier
FROM transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID;

-- 2.Extract Contact Information of top 10 customers with the most Total Revenue.
SELECT 
t.Customer_ID, 
t.Total_Revenue,
c.Email_Address,
c.Phone_Number FROM transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID
ORDER BY Total_Revenue DESC
LIMIT 10;

-- 3.Get the customer details of all customers whose total revenue is greater than 2000.
SELECT
t.Customer_ID,
t.Total_Revenue,
c.Email_Address,
c.Phone_Number
FROM Transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID
WHERE Total_Revenue>2000;

-- 4.Find all customers from the store location New York and display what products they purchased.
SELECT
t.Customer_ID,
t.Product_Name,
c.Store_Location
FROM Transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID
WHERE Store_Location="New York";

-- 5.List customer IDs, emails, and product names for customers who purchased more than 5 units of a product.
SELECT 
t.Customer_ID,
t.Product_Name,
t.Units_Sold,
c.Email_Address
FROM Transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID
WHERE Units_Sold>5;

/*We can also use JOIN function on three tables as well*/

-- 6.Extract the customer ID, email, product purchased, and feedback type for all customers who gave feedback.
SELECT
t.Customer_ID,
t.Product_Name,
c1.Email_Address,
c2.Feedback_Type
FROM Transactions AS t
JOIN Customer_Details AS c1
ON t.Customer_ID=c1.Customer_ID
JOIN Customer_Support AS c2
ON c1.Email_Address=c2.Email_Address;

-- 7.Find the top 5 customers by revenue along with their membership tier and satisfaction rating from customer support.
SELECT
t.Customer_ID,
t.Total_Revenue,
c1.Membership_Tier,
c2.SatisfactionRating
FROM transactions AS t
JOIN Customer_Details AS c1
ON t.Customer_ID=c1.Customer_ID
JOIN Customer_Support AS c2
ON c1.email_Address=c2.Email_Address
ORDER BY Total_Revenue DESC
LIMIT 5;

-- 8.Show all customers who bought a product in the Electronics category, their contact info, and the resolution status of their latest feedback.
SELECT 
t.Customer_ID,
t.Product_Category,
c1.Email_Address,
c1.Phone_Number,
c2.Feedback_Type,
c2.Resolution_Status
FROM transactions AS t
JOIN Customer_Details AS c1
ON t.Customer_ID=c1.Customer_ID
JOIN Customer_Support AS c2
ON c1.Email_Address=c2.Email_Address
WHERE Product_Category="Electronics";

/*JOINS can also be used in combination with Sub queries.Here are a couple of examples.*/

-- 9.Find contact information of customers whose total revenue is above the average revenue of all customers.
SELECT
t.Customer_ID,
t.Total_Revenue,
c.Email_Address,
c.Phone_Number
FROM Transactions AS t
JOIN Customer_Details AS c
ON t.Customer_ID=c.Customer_ID
WHERE t.Total_Revenue >
	(SELECT AVG(Total_Revenue) FROM transactions);

-- 10.List the customer IDs and emails of customers who have given feedback, but spent less than the highest total revenue recorded.
SELECT 
t.Customer_ID,
t.Total_Revenue,
c1.Email_Address,
c2.Feedback_Type
FROM transactions AS t
JOIN Customer_Details AS c1
ON t.Customer_ID=c1.Customer_ID
JOIN Customer_Support AS c2
ON c1.Email_Address=c2.Email_Address
WHERE t.Total_Revenue <
	(SELECT Max(Total_Revenue) FROM Transactions);